import 'bootstrap/dist/css/bootstrap.min.css';

export const User = () => {
  return (
    <Container>
      <div className="admin-card">
        <h2 className="admin-card-title">Create User</h2>
        <Form className="admin-form">
          <p className="admin-input-title">Username</p>
          <input className="admin-input" placeholder="Username.."></input>
          <input className="admin-input" placeholder="Password.."></input>
        </Form>
      </div>
    </Container>
  );
};
